import React from 'react';

class OrganismList extends React.Component {
    constructor(props: Readonly<{}>) {
        super(props);
        this.state = {
            organisms: [],
            selectedOrganism: '',
            organismConfigs: {},
        };
    }
    onChange = (event: { target: { value: any; }; }) => {
        this.setState({selectedOrganism: event.target.value});
    }

    render() {
        return (
            <h1> This is the organism list</h1>
        )
    }
}

export default OrganismList;
